import React, {useContext} from 'react';
// import Drawer from '@mui/material/Drawer';
import Box from '@mui/material/Box';
// import List from '@mui/material/List';
// import IconButton from '@mui/material/IconButton';
// import MenuIcon from '@mui/icons-material/Menu';
// import ListItem from '@mui/material/ListItem';
// import CloseIcon from '@mui/icons-material/Close';
// import Divider from '@mui/material/Divider';
import Toolbar from '@mui/material/Toolbar';
import SettingsIcon from '@mui/icons-material/Settings';
import {ThemeStateContext} from './Contexts';
// const pages = ['Contact', 'Projects', 'Resume', 'Games'];
/**
 * Navbar Drawer creator
 * @return {object} JSX
 */
function CustomNavbar() {
  /* State to track if collapsed navbar open */
  // const [isOpen, changeIsOpen] = useState(false);
  const changeTheme = useContext(ThemeStateContext);
  return (
  <Box sx={{ flexGrow: 1 }}>
    <AppBar position="static" enableColorOnDark>
      <Toolbar>
        <IconButton>
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          News
        </Typography>
        <IconButton onClick = {changeTheme = 'dark'}>
          <SettingsIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  </Box>
  )
};
export {CustomNavbar};
